/**
 * FixedSize block allocator
 */
template<typename Alloc = std::allocator<char>>
struct FixedPool : private Alloc
{
    using allocator_type = Alloc;

    FixedPool(Alloc inAlloc = Alloc()) : Alloc(inAlloc),
        mBlocks(inAlloc),
        mChunks(inAlloc)
    {
    }

    ~FixedPool()
    {
        while (!mChunks.empty())
        {
            getParentAllocator().deallocate((char*)mChunks.back(), mBlockSize);
            mChunks.pop_back();
        }
    }

    void reserve(std::size_t block_size, std::size_t block_count)
    {
        assert(mBlockSize == 0 || mBlockSize == block_size);
        mBlocks.reserve(mBlocks.size() + block_count);
        auto chunk_size = block_size * block_count;
        void* chunk = getParentAllocator().allocate(chunk_size);
        mChunks.push_back(chunk);
        void* end = static_cast<char*>(chunk) + chunk_size;
        for (auto i = 0ul; i != block_count; ++i)
        {
            mBlocks.push_back(chunk);
            chunk = (char*)chunk + block_size;
        }
        assert(chunk == end);

    }

    void* allocate(std::size_t block_size)
    {
        if (!mBlockSize)
        {
            mBlockSize = block_size;
        }
        else
        {
            assert(mBlockSize == block_size);
        }

        // std::cout << "allocate: " << block_size << std::endl;
        if (mBlocks.empty())
        {
            reserve(block_size, 10);
            assert(!mBlocks.empty());
        }

        auto result = mBlocks.back();
        mBlocks.pop_back();
        return result;
    }

    void deallocate(void* data, std::size_t block_size)
    {
        // std::cout << "deallocate: " << block_size << std::endl;
        mBlocks.resize(mBlocks.size() + 1);
        mBlocks.back() = static_cast<void*>(data);
        assert(block_size == mBlockSize);
    }

    std::size_t size() const
    {
        return mBlocks.size();
    }

private:
    allocator_type getParentAllocator() const noexcept
    {
        return static_cast<const Alloc&>(*this);
    }

    using OtherAlloc = typename Alloc::template rebind<void*>::other;

    std::vector<void*, OtherAlloc> mBlocks;
    std::vector<void*, OtherAlloc> mChunks;
    std::size_t mBlockSize = 0;
};


/**
 * Manages fixed-size block allocators per size.
 */
struct FlexiblePool
{
    ~FlexiblePool()
    {
        print_stats();
    }
    void print_stats()
    {
        std::cout << "*** MEMORY POOL STATS ***" << std::endl;
        std::size_t total_bytes = 0;
        for (auto& element : mPools)
        {
            auto byte_count = (element.first * element.second.size());
            total_bytes += byte_count;
            std::cout
                << "segment_size=" << std::setw(4) << std::setfill(' ') << element.first
                << " segment_count=" << std::setw(4) << std::setfill(' ') << element.second.size()
                << " total_size=" << std::setw(6) << std::setfill(' ') << byte_count << " bytes"
                << '\n'
                ;
        }
        std::cout << "Total ByteCount: " << total_bytes << " AllocationCount=" << mNumAllocs << " DeallocationCount=" << mNumDeallocs << std::endl;
        std::cout << "--- END OF STATS --- \n" << std::endl;
    }
    void* allocate(std::size_t block_size)
    {
        mNumAllocs++;
        block_size = align(block_size);
        return mPools[block_size].allocate(block_size);
    }

    void deallocate(void* data, std::size_t block_size)
    {
        mNumDeallocs++;
        block_size = align(block_size);
        mPools[block_size].deallocate(data, block_size);
    }

    std::size_t align(std::size_t block_size)
    {
        enum { alignment = 16 };
        auto r = block_size % alignment;
        return block_size + bool(r) * (alignment - r);
    }
    std::map<std::size_t, FixedPool<>> mPools;
    std::size_t mNumAllocs = 0;
    std::size_t mNumDeallocs = 0;
};


/**
 * STL allocator interface for the memory pool.
 */
template<typename T>
struct PoolAllocator
{
    typedef T * pointer;
    typedef const T * const_pointer;
    typedef T& reference;
    typedef const T& const_reference;
    typedef T value_type;
    typedef std::size_t size_type;
    typedef std::ptrdiff_t difference_type;

    template<typename U>
    struct rebind { typedef PoolAllocator<U> other; };

    PoolAllocator(FlexiblePool& inFlexiblePool) : mFlexiblePool(&inFlexiblePool) { assert(mFlexiblePool); }

    template<typename U>
    PoolAllocator(const PoolAllocator<U>& rhs) : mFlexiblePool(rhs.mFlexiblePool) { assert(mFlexiblePool); }

    template<typename U>
    PoolAllocator& operator=(const PoolAllocator<U>& rhs)
    { mFlexiblePool = rhs.mFlexiblePool; return *this; }

    const T* address(const T& s) const { return &s; }
    T* address(T& r) const { return &r; }

    size_t max_size() const { return std::size_t(-1); }

    bool operator==(const PoolAllocator& rhs) const { return mFlexiblePool == rhs.mFlexiblePool; }
    bool operator!=(const PoolAllocator& rhs) const { return mFlexiblePool != rhs.mFlexiblePool; }

    template<typename U, typename ...Args>
    auto construct(U* p, Args&& ...args) -> decltype(void())
    { new ((void*)p) U(std::forward<Args>(args)...); }

    void destroy(T * const p) const
    { p->~T(); }

    T* allocate(size_t n) const
    { return static_cast<T*>(mFlexiblePool->allocate(n * sizeof(T))); }

    void deallocate(T * const p, const size_t n) const
    { mFlexiblePool->deallocate(p, n * sizeof(T)); }

    template <typename U>
    T * allocate(const size_t n, const U*) const
    { return this->allocate(n); }

    FlexiblePool* mFlexiblePool;
};


/**
 * scoped_allocator_adaptor to propagate allocator to nested objects
 */
template<typename T>
using Allocator = std::scoped_allocator_adaptor<PoolAllocator<T>>;


using string = boost::container::basic_string<char, std::char_traits<char>, Allocator<char>>;


template<typename T>
using vector = std::vector<T, Allocator<T>>;


template<typename K, typename V>
using map = std::map<K, V, std::less<K>, Allocator<std::pair<const K, V>>>;


template<typename Alloc>
void test(Alloc& alloc);


